import './App.css';
import Greet from './components/Greet';
import Welcome from './components/Welcome';

function App() {
  return (
    <div className="App">
      <Greet name ="Alice" lastName="Bob" />
      <Greet name ="Annie" lastName="John" />
      <Welcome />
    </div>
  );
}

export default App;
